import React from "react";
import Layout from "../../Layout";
import Main from "../../Main";
import inhabitants from "./data";

const Users = () => {
    return (
        <Layout id={15}>
            <Main>
                <h1>Users</h1>

                <table className="table">
                    <thead>
                        <tr>
                            <th>Imagen</th>
                            <th>Nombre</th>
                            <th>Edad</th>
                            <th>Peso</th>
                            <th>Altura</th>
                            <th>Color de pelo</th>
                            <th>Profesiones</th>
                            <th>Amigos</th>
                        </tr>
                    </thead>
                    <tbody>
                        {inhabitants.map(({id, name, thumbnail, age, weight, height, hair_color, professions, friends }) => {
                            return (
                                <tr>
                                    <td>{id}</td>
                                    <td>{name}</td>
                                    <td>{thumbnail}</td>
                                    <td>{age}</td>
                                    <td>{weight}</td>
                                    <td>{height}</td>
                                    <td>{hair_color}</td>
                                    <td>{professions}</td>
                                    <td>{friends}</td>
                                </tr>
                            )
                        })}

                    </tbody>
                </table>
            </Main>
        </Layout>
    );
};

export { Users };
